import React, { useState } from 'react';
import PropTypes from 'prop-types';

const ProjectCard = ({ title, description, tech, image, links }) => {
  const [isExpanded, setIsExpanded] = useState(false);
  const [isHovered, setIsHovered] = useState(false);

  const shortDescription = description.slice(0, 100);
  const hasMoreContent = description.length > 100;

  return (
    <div 
      className="relative group"
      onMouseEnter={() => setIsHovered(true)}
      onMouseLeave={() => setIsHovered(false)}
    >
      {/* Main Card */}
      <div className={`border border-[#ABB2BF] bg-[#282C33] transition-all duration-300 ${
        isHovered ? 'transform -translate-y-2 shadow-xl shadow-[#C778DD]/20' : ''
      }`}>
        <div className="aspect-video overflow-hidden">
          <img 
            src={image} 
            alt={title}
            className="w-full h-full object-cover group-hover:scale-105 transition-transform duration-300"
          />
        </div>
        <div className="p-4">
          <div className="flex gap-2 mb-2">
            {tech.map((item, index) => (
              <span key={index} className="text-sm text-[#C778DD]">#{item}</span>
            ))}
          </div>
          <h3 className="text-xl font-bold mb-2">{title}</h3>
          <p className="text-[#ABB2BF] mb-4">
            {isExpanded ? description : shortDescription}
            {hasMoreContent && !isExpanded && '...'}
          </p>
          {hasMoreContent && (
            <button
              onClick={() => setIsExpanded(!isExpanded)}
              className="text-[#C778DD] hover:underline mb-4"
            >
              {isExpanded ? 'Show less' : 'Read more'}
            </button>
          )}
          <div className="flex gap-4">
            {links.map((link, index) => (
              <a
                key={index}
                href={link.url}
                target="_blank"
                rel="noopener noreferrer"
                className="border border-[#C778DD] px-4 py-2 hover:bg-[#C778DD] hover:text-white transition-colors"
              >
                {link.text}
              </a>
            ))}
          </div>
        </div>
      </div>

      {/* Hover Card (Pop-up) */}
      {isHovered && !isExpanded && (
        <div className="absolute top-full left-0 right-0 mt-2 p-4 bg-[#282C33] border border-[#C778DD] shadow-xl z-10 opacity-0 group-hover:opacity-100 transition-opacity duration-300">
          <p className="text-[#ABB2BF] text-sm">
            {description}
          </p>
        </div>
      )}
    </div>
  );
};

ProjectCard.propTypes = {
  title: PropTypes.string.isRequired,
  description: PropTypes.string.isRequired,
  tech: PropTypes.arrayOf(PropTypes.string).isRequired,
  image: PropTypes.string.isRequired,
  links: PropTypes.arrayOf(
    PropTypes.shape({
      text: PropTypes.string.isRequired,
      url: PropTypes.string.isRequired,
    })
  ).isRequired,
};

const Projects = () => {
  const projects = [
    {
      title: "ChertNodes",
      description: "ChertNodes is a modern and efficient Minecraft server hosting platform that provides an intuitive control panel for easy server management. The platform features automatic backups, custom domain support, and mod installation capabilities. Users can easily scale their servers, monitor performance metrics, and manage their Minecraft communities all from one centralized dashboard. The system includes advanced security features and 24/7 server monitoring to ensure optimal performance and reliability.",
      tech: ["react", "express", "cloud"],
      image: "/images/chertnodes.svg",
      links: [
        { text: "Live <~>", url: "#" },
        { text: "Code </>", url: "#" }
      ]
    },
    {
      title: "ProtectX",
      description: "ProtectX is a sophisticated Discord anti-crash bot that provides advanced security features for server protection. The bot implements intelligent algorithms to detect and prevent raid attempts, spam, and malicious content. It offers detailed logging capabilities, customizable security settings, and real-time threat detection. Server administrators can configure various protection levels and receive instant notifications about potential security threats.",
      tech: ["discord.js", "node.js"],
      image: "/images/protectx.svg",
      links: [
        { text: "Live <~>", url: "#" },
        { text: "Code </>", url: "#" }
      ]
    },
    {
      title: "Kahoot Answers Viewer",
      description: "This Chrome extension enhances the Kahoot learning experience by providing a comprehensive answer viewing system. It helps educators and content creators verify their quiz accuracy in real-time. The tool features an intuitive interface, quick response validation, and detailed analytics about question performance. It supports multiple Kahoot game modes and provides instant feedback for quiz creators.",
      tech: ["chrome", "javascript"],
      image: "/images/kahoot.svg",
      links: [
        { text: "Live <~>", url: "#" },
        { text: "Code </>", url: "#" }
      ]
    }
  ];

  return (
    <section id="projects" className="py-20 px-4 md:px-8">
      <div className="max-w-6xl mx-auto">
        <h2 className="text-3xl font-bold mb-8">
          <span className="text-[#C778DD]">#</span>projects
        </h2>
        <div className="grid md:grid-cols-2 gap-8">
          {projects.map((project, index) => (
            <ProjectCard key={index} {...project} />
          ))}
        </div>
      </div>
    </section>
  );
};

export default Projects;
